import torch
import matplotlib.pyplot as plt

def plotLearningCurves(train_loss, val_loss, g2g_num):
    print(len(train_loss))
    print(len(val_loss))

    print("train_loss: ", train_loss)
    print("val_loss: ", val_loss)

    train_loss = torch.Tensor(train_loss)
    val_loss = torch.Tensor(val_loss)

    plt.figure(figsize=(10, 5))
    plt.title("Training and Validation Loss - " + str(g2g_num) + " g2g modules")
    plt.xticks(range(1, len(train_loss) + 1, 100))
    plt.plot([i + 1 for i in range(len(train_loss))], val_loss, label="val")
    plt.plot([i + 1 for i in range(len(train_loss))], train_loss, label="train")
    plt.xlabel("iterations")
    plt.ylabel("Loss")
    plt.legend()
    plt.show()

